import React from 'react'

class View extends React.Component {
   render() {
       return(
           <div>
               <table>
                <thead>
                <tr>
                <th><span>{this.props.data.title}</span></th>
                <th><span>{this.props.data.author}</span></th>
                </tr>
                 </thead>
                </table>

               <span>{this.props.data.title}</span>
               <span>{this.props.data.author}</span>
          </div>
       )
   } 
}

export default View;
